import React, { useState } from "react";
import { useForm, useFieldArray } from "react-hook-form";
import { zodResolver } from "@hookform/resolvers/zod";
import { useRouter } from "next/router";
import { z } from "zod";
import { api } from "y/utils/api";

export type RecipeInput = {
  title: string;
  ingredients: {
    amount: number;
    name: string;
  }[];
  description: string;
  yield: number;
  directions: string;
  image: string;
  tags: {
    name: string;
  }[];
};

export const ZodRecipeInput = z.object({
  title: z
    .string({ required_error: "Recipe title must be provided" })
    .min(4)
    .max(15),
  ingredients: z
    .object({
      amount: z.number({
        required_error: "amount of ingredient must be provided",
      }),
      name: z
        .string({ required_error: "ingredient name must be provided" })
        .min(3)
        .max(15),
    })
    .array(),
  description: z.string(),
  yield: z.number(),
  directions: z.string(),
  image: z.string(),
  tags: z
    .object({
      name: z.string({ required_error: "tag name must be provided" }),
    })
    .array(),
}) satisfies z.ZodType<RecipeInput>;

type FormValues = z.infer<typeof ZodRecipeInput>;

const CreateRecipePage: React.FC = () => {
  const router = useRouter();
  const [submitting, setSubmitting] = useState(false);
  const {
    register,
    handleSubmit,
    control,
    formState: { errors },
  } = useForm<FormValues>({
    resolver: zodResolver(ZodRecipeInput),
    defaultValues: {
      ingredients: [{ name: "", amount: 0 }],
      tags: [],
    },
  });

  const {
    fields: ingredientsFields,
    append: appendIngredient,
    remove: removeIngredient,
  } = useFieldArray({
    control,
    name: "ingredients",
  });

  const {
    fields: tagsFields,
    append: appendTag,
    remove: removeTag,
  } = useFieldArray({
    control,
    name: "tags",
  });

  const { mutate } = api.recipe.createRecipe.useMutation();

  const onSubmit = async (data: FormValues) => {
    setSubmitting(true);
    try {
      mutate(data);
      router.push("/");
    } catch (error) {
      console.error(error);
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <div className="container mx-auto py-8">
      <h1 className="mb-6 text-2xl font-semibold">Create a new recipe</h1>
      <form onSubmit={handleSubmit(onSubmit)} className="space-y-6">
        <div className="space-y-2">
          <label htmlFor="title" className="block font-medium">
            Title
          </label>
          <input
            {...register("title")}
            id="title"
            type="text"
            className="w-full border border-gray-300 px-3 py-2 focus:border-transparent focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
          {errors.title && (
            <p className="text-xs text-red-500">{errors.title.message}</p>
          )}
        </div>

        <div>
          <h2 className="mb-4 text-lg font-medium">Ingredients</h2>
          {ingredientsFields.map((ingredientField, index) => (
            <div
              key={ingredientField.id}
              className="mb-4 flex items-end space-x-4"
            >
              <div className="w-1/2 space-y-2">
                <label
                  htmlFor={`ingredients.${index}.name`}
                  className="block font-medium"
                >
                  Ingredient Name
                </label>
                <input
                  {...register(`ingredients.${index}.name`)}
                  id={`ingredients.${index}.name`}
                  type="text"
                  className="w-full border border-gray-300 px-3 py-2 focus:border-transparent focus:outline-none focus:ring-2 focus:ring-blue-500"
                />
                {errors.ingredients?.[index]?.name && (
                  <p className="text-xs text-red-500">
                    {errors?.ingredients[index]?.name?.message}
                  </p>
                )}
              </div>
              <div className="w-1/2 space-y-2">
                <label
                  htmlFor={`ingredients.${index}.amount`}
                  className="block font-medium"
                >
                  Amount
                </label>
                <input
                  {...register(`ingredients.${index}.amount`)}
                  id={`ingredients.${index}.amount`}
                  type="number"
                  step="0.01"
                  className="w-full border border-gray-300 px-3 py-2 focus:border-transparent focus:outline-none focus:ring-2 focus:ring-blue-500"
                />
                {errors.ingredients?.[index]?.amount && (
                  <p className="text-xs text-red-500">
                    {errors?.ingredients[index]?.amount?.message}
                  </p>
                )}
              </div>
              <button
                type="button"
                onClick={() => removeIngredient(index)}
                className="text-red-500"
              >
                Remove
              </button>
            </div>
          ))}
          <button
            type="button"
            onClick={() => appendIngredient({ name: "", amount: 0 })}
            className="text-blue-500"
          >
            Add Ingredient
          </button>
        </div>

        <div className="space-y-2">
          <label htmlFor="description" className="block font-medium">
            Description
          </label>
          <textarea
            {...register("description")}
            id="description"
            rows={3}
            className="w-full border border-gray-300 px-3 py-2 focus:border-transparent focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        <div className="space-y-2">
          <label htmlFor="yield" className="block font-medium">
            Yield
          </label>
          <input
            {...register("yield")}
            id="yield"
            type="number"
            className="w-full border border-gray-300 px-3 py-2 focus:border-transparent focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
          {errors?.yield && (
            <p className="text-xs text-red-500">{errors?.yield.message}</p>
          )}
        </div>

        <div className="space-y-2">
          <label htmlFor="directions" className="block font-medium">
            Directions
          </label>
          <textarea
            {...register("directions")}
            id="directions"
            rows={3}
            className="w-full border border-gray-300 px-3 py-2 focus:border-transparent focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        <div className="space-y-2">
          <label htmlFor="image" className="block font-medium">
            Image URL
          </label>
          <input
            {...register("image")}
            id="image"
            type="text"
            className="w-full border border-gray-300 px-3 py-2 focus:border-transparent focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        <div>
          <h2 className="mb-4 text-lg font-medium">Tags</h2>
          {tagsFields.map((tagField, index) => (
            <div key={tagField.id} className="mb-4 flex items-end space-x-4">
              <div className="w-full space-y-2">
                <label htmlFor={`tags.${index}`} className="block font-medium">
                  Tag
                </label>
                <input
                  {...register(`tags.${index}`)}
                  id={`tags.${index}`}
                  type="text"
                  className="w-full border border-gray-300 px-3 py-2 focus:border-transparent focus:outline-none focus:ring-2 focus:ring-blue-500"
                />
              </div>
              <button
                type="button"
                onClick={() => removeTag(index)}
                className="text-red-500"
              >
                Remove
              </button>
            </div>
          ))}
          <button
            type="button"
            onClick={() => appendTag({ name: "" })}
            className="text-blue-500"
          >
            Add Tag
          </button>
        </div>

        <div className="mt-8">
          <button
            type="submit"
            disabled={submitting}
            className={`rounded-lg bg-blue-500 py-2 px-4 font-semibold text-white shadow-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-opacity-50 ${
              submitting ? "cursor-not-allowed opacity-50" : ""
            }`}
          >
            Create Recipe
          </button>
        </div>
      </form>
    </div>
  );
};

export default CreateRecipePage;

